        0: "Dieser Nexus ist lediglich f\xFCr den Transport von humanoiden Wesen bestimmt, die eine K\xF6rpergr\xF6\xDFe von 300 Fingerbreiten und 745 Pfund nicht \xFCberschreiten. Dar\xFCber hinausgehende K\xF6rpergr\xF6\xDFe oder Masse kann zu temporaler oder permanenter Phasenverschiebung des Reisenden oder im schlimmsten Falle, zum Tode f\xFChren. \n\n\
          Zu eurer eigenen Sicherheit und zur vermeidung von translokalen Unf\xE4llen befinden sich hier lediglich Ein-Weg Teleporter. Falls euer Ziel dynamisch bestimmt wurde, stellt sicher dass sie eine R\xFCckkehrm\xF6glichkeit habt.\n\n\
